-- ----------------------------
-- Table structure for visitor_book
-- ----------------------------
DROP TABLE IF EXISTS `visitor_book`;
CREATE TABLE `visitor_book` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `visitorId` varchar(255) DEFAULT NULL COMMENT '预约记录id',
  `visitDepartCode` varchar(255) DEFAULT NULL COMMENT '拜访组织机构 code',
  `visitDepartName` varchar(255) DEFAULT NULL COMMENT '拜访组织机构名称',
  `visitPurpose` varchar(2000) DEFAULT NULL COMMENT '访问事由',
  `baseFloor` int(255) DEFAULT NULL COMMENT '最低楼层',
  `visitFloor` varchar(255) DEFAULT NULL COMMENT '访问楼层',
  `visitStartTime` bigint(20) DEFAULT NULL COMMENT '访问开始时间',
  `visitEndTime` bigint(20) DEFAULT NULL COMMENT '访问结束时间',
  `effecNumber` int(11) DEFAULT NULL COMMENT '访问有效次数',
  `fromType` int(255) DEFAULT NULL COMMENT '拜访来源(1 有人值守访客机、 2自助访客机、3 微信公众号、4第三方平台、5APP、6 微信小程序)',
  `visitType` int(255) DEFAULT NULL COMMENT '访问类型（1 邀请、2 预约）',
  `visitorUserWxId` varchar(255) DEFAULT NULL COMMENT '被访者微信id',
  `visitUserTelephone` varchar(255) DEFAULT NULL COMMENT '被访人用户手机号码',
  `visitUserName` varchar(255) DEFAULT NULL COMMENT '被访人用户名称',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `cancelApproval` varchar(255) DEFAULT NULL COMMENT '是否强制取消审批，默认不取消（1 取消，0 不取消）',
  `cancelCertificate` varchar(255) DEFAULT NULL COMMENT '是否强制取消现场认证，默认不取消（1 取消，0 不取消）',
  `carNO` varchar(255) DEFAULT NULL COMMENT '访客车牌号',
  `approveType` varchar(255) DEFAULT NULL COMMENT '审批类型:1访客 2 车位',
  `approveStatus` varchar(255) DEFAULT '0' COMMENT '审批状态:0 未审批、1 审批 2 拒绝、3 不审批',
  `parkingStatus` varchar(255) DEFAULT '0' COMMENT '审批状态（0，待审批 1 预约失败，2 预约拒绝，3 预约成功）',
  `approveRemark` varchar(500) DEFAULT NULL COMMENT '审批备注',
  `reason` varchar(255) DEFAULT NULL COMMENT '黑白名单原因',
  `visitStatus` varchar(255) DEFAULT NULL COMMENT '状态（1 正常，2 需要审批，3 现场认证）',
  `visitorType` varchar(11) DEFAULT NULL COMMENT '黑白名单类型（0 黑，1 白）',
  `qrcodeKey` varchar(2000) DEFAULT NULL COMMENT '访客二维码数据',
  `codeId` varchar(255) DEFAULT NULL COMMENT '访客二维码 id',
  `visitorCode` varchar(255) DEFAULT NULL COMMENT '访客码',
  `visitorName` varchar(255) DEFAULT NULL COMMENT '访客姓名',
  `visitorTelephone` varchar(255) DEFAULT NULL,
  `visitorWxId` varchar(255) DEFAULT NULL,
  `printStatus` varchar(255) DEFAULT NULL COMMENT '领码状态（1 未领码、2 已领码）',
  `approveTime` bigint(20) DEFAULT NULL COMMENT '审批时间',
  `printTime` bigint(20) DEFAULT NULL COMMENT '发码时间',
  `createTime` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COMMENT='访客记录表';

-- ----------------------------
-- Records of visitor_book
-- ----------------------------

