  `id` int(11) NOT NULL AUTO_INCREMENT,
  `visitorId` varchar(255) DEFAULT NULL COMMENT '预约记录id',
  `IDType` varchar(255) DEFAULT NULL COMMENT '访客证件类型，默认身份证（1身份证）',
  `name` varchar(255) DEFAULT NULL COMMENT '访客姓名',
  `gender` varchar(255) DEFAULT NULL COMMENT '访客性别（1 男，2 女）',
  `race` varchar(255) DEFAULT NULL COMMENT '访客民族',
  `birthday` varchar(255) DEFAULT NULL COMMENT '访客生日',
  `census_addr` varchar(255) DEFAULT NULL COMMENT '访客地址',
  `iden_number` varchar(255) DEFAULT NULL COMMENT '访客证件号码',
  `police` varchar(255) DEFAULT NULL COMMENT '访客发证机关',
  `active_from` varchar(255) DEFAULT NULL COMMENT '访客证件有效起始时间',
  `active_to` varchar(255) DEFAULT NULL COMMENT '访客证件有效结束时间',
  `card_id` varchar(255) DEFAULT NULL COMMENT '访客证件卡号',
  `head_img_name` varchar(5000) DEFAULT NULL COMMENT '访客证件头像',
  `visitorTelephone` varchar(255) DEFAULT NULL COMMENT '访客电话号码',
  `visitorWxId` varchar(255) DEFAULT NULL COMMENT '访客微信id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8 COMMENT='访客信息表';

